var random = Math.floor(Math.random() * 100000);
var email = "testqa".concat(random, "@qa.com");
var user = {
  nome: 'test',
  email: email,
  password: 'test',
  administrador: 'true'
};
// Create the user
cy.request({
  method: 'POST',
  url: 'https://serverest.dev/usuarios',
  body: user,
  headers: {
    'Content-Type': 'application/json',
    Accept: 'application/json'
  },
  failOnStatusCode: false
}).then(function (createRes) {
  expect(createRes.status).to.eq(201);
  expect(createRes.body.message).to.eq('Cadastro realizado com sucesso');
  cy.log("\uD83D\uDD10 Logging in with: ".concat(user.email, " | Password: ").concat(user.password));
  // Log in with the same user
  cy.request({
    method: 'POST',
    url: 'https://serverest.dev/login',
    body: {
      email: user.email,
      password: user.password
    },
    headers: {
      'Content-Type': 'application/json',
      Accept: 'application/json'
    },
    failOnStatusCode: false
  }).then(function (loginRes) {
    expect(loginRes.status).to.eq(200);
    expect(loginRes.body).to.have.property('authorization');
    cy.log('âœ… Token received:', loginRes.body.authorization);
  });
});
